(function( document ) {
	var docElem, body, docHeight, docWidth;
	docElem = document.documentElement;
	body = document.body;
	docHeight = docElem.clientHeight;
	docWidth = docElem.clientWidth;
	i = 20;
	window.requestAnimationFrame = window.requestAnimationFrame ||
		window.webkitRequestAnimationFrame ||
		window.mozRequestAnimationFrame ||
		function( callback ) {
			window.setTimeout(callback, 1000 / 60);
		};

	function addSprinkle() {
		requestAnimationFrame(addSprinkle);
		var div, style, top;
		div = document.createElement('div');
		style = div.style;
		top = 0;
		style.width = (1 + (Math.random() * 2) | 0) + 'px';
		style.height = '5px';
		style.position = 'absolute';
		style.top = top + 'px';
		style.left = 5 + (Math.random() * (docWidth - 7) | 0) + 'px';
		style.backgroundColor = '#'+ Math.floor(Math.random() * 16777215).toString(16);
		(function animateSprinkle() {
			if (top > docHeight) {
				docElem.removeChild(div);
			} else {
				requestAnimationFrame(animateSprinkle);
				style.top = (top += 2) + 'px';
				style.webkitTransform = style.mozTransform = style.transform = 'rotateZ(' + (Math.random() * 360) + 'deg)';
			}
		})();
		docElem.appendChild(div);
	}

	(function addPic() {
		if (i--) {
			requestAnimationFrame(addPic);
		} else {
			addSprinkle();
		}
		var img, style;
		img = document.createElement('img');
		img.src = 'data:image/jpeg;base64,';
		style = img.style;
		style.position = 'absolute';
		style.top = Math.random() * (Math.max(
			docElem.offsetHeight, body.offsetHeight,
			docElem.scrollHeight, body.scrollHeight,
			docElem.clientHeight
		) - 450) + 'px';
		style.left = Math.random() * (Math.max(
			docElem.offsetWidth, body.offsetWidth,
			docElem.scrollWidth, body.scrollWidth,
			docElem.clientWidth
		) - 300) + 'px';
		docElem.appendChild(img);
	})();
})( document );
